import React from 'react';
import './css/UI.css';

function Head(){
  var name="Antony Otieno";
  var about="I like to read books.";
    return(
      <div className="Head Card">
      <br></br>
      <div className="img"></div>
      <br></br>
      <div className="card-body">
      {name}
      {about}
      </div>
      </div>
  );
}
export default Head;
